create or alter function f_IsCompanyTypeIE(@COMPANY_TYPE nvarchar(40))
RETURNS bit
AS
BEGIN
	declare @IS_COMPANY_IE bit
	if @COMPANY_TYPE is null
		set @IS_COMPANY_IE = 0
	else
	begin
		set @COMPANY_TYPE = upper(ltrim(rtrim(@COMPANY_TYPE)))
		set @IS_COMPANY_IE =
			case
				when left(@COMPANY_TYPE, 1) = N'Ա' and right(@COMPANY_TYPE, 1) = N'Ձ' then 1
				else 0
			end
	end

	return @IS_COMPANY_IE
END
GO

create or alter procedure sp_GetApplicationForACRALegalRequestByID(@ID	uniqueidentifier)
AS
	select a.ID,a.TAX_ID_NUMBER,
		case
			when rtrim(isnull(n.NAME,''))='' then isnull(e.NAME_AM,'')
			else n.NAME
		end as NAME
		,isnull(a.IMPORT_ID,0) as IMPORT_ID
		,dbo.f_IsCompanyTypeIE(e.TYPE) as IsIE
	from APPLICATION a
	join NORQ_LEGAL_QUERY_RESULT n
		on n.APPLICATION_ID=a.ID
	left join EREGISTER_QUERY_RESULT e
		on e.APPLICATION_ID=a.ID
	where a.ID=@ID
GO

